package com.noida.learning.ds.hackerrank;

import java.util.HashSet;

public class UniformString {

    static String[] weightedUniformStrings(String s, int[] queries) {
        HashSet<Integer> hs = new HashSet<Integer>();
        String output[] = new String[queries.length];
        int frequency[] = new int[26];
        int value = 0;

        for (int i = 0; i < s.length(); i++) {
            value = (int) s.charAt(i) - 96;
            ++frequency[value-1];
            if (!hs.contains(value)) {
                hs.add(value);
            } else {
                value =value*frequency[value-1];
                hs.add(value);

            }
        }

        for (int i = 0; i < queries.length; i++) {
            if (hs.contains(queries[i])) {
                output[i] = "Yes";
            } else {
                output[i] = "No";
            }
        }

        return output;
    }

    public static void main(String[] args) {
        String input = "";
        int queries[] = new int[]{1,
                24491,
                17108,
                351600,
                187860,
                1863065,
                495765,
                13258,
                204700,
                2946849,
                208848,
                2644640,
                2145865,
                1205263,
                138092,
                244316,
                377800,
                79415,
                20335};
        String output[] = weightedUniformStrings(input,queries );
        for(String s: output){
            System.out.println(s);
        }
    }
}
